import { combineReducers } from "redux"

const initailState = {
    user: "default",
    auth: null,
    serverPods: "default",
    serverSVC: "default",
    env: {
        env: [
            { name: "ErrName1", value: "ErrValue1" },
            { name: "ErrName2", value: "ErrValue2" },
            { name: "ErrName3", value: "ErrValue3" },
            { name: "ErrName4", value: "ErrValue4" },
            { name: "ErrName5", value: "ErrValue5" },
            { name: "ErrName6", value: "ErrValue6" },
            { name: "ErrName7", value: "ErrValue7" },
            { name: "ErrName8", value: "ErrValue8" }
        ]
    }
}

const reducer = (state = initailState, action) => {

    switch (action.type) {
        case "FETCH_USER_SUCCESS":
            return {
                ...state,
                user: action.payload
            }
        case "AUTH_SUCCESS":
            return {
                ...state,
                auth: action.payload
            }
        case "SERVER_PODS_DATA":
            return {
                ...state,
                serverPods: action.payload
            }
        case "SERVER_SVC_DATA":
            return {
                ...state,
                serverSVC: action.payload
            }
        case "MC_CONF_GET_DATA":
            return {
                ...state,
                env: action.payload
            }
        case "DUMP":
            return {
                ...state,
            }
        default:
            return {
                ...state
            }
    }
}

export default reducer
